contracts/0_2_Notas.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

contract Notas {
    mapping (address => uint[]) notas;

    function obtenerPromedio(address alumno) public view returns (uint) {
        require(notas[alumno].length > 0);
        uint suma;
        for (uint i = 0; i < notas[alumno].length; i++) {
            suma += notas[alumno][i];
        }
        return suma / notas[alumno].length;
    }
}

